import { StyleSheet } from "@react-pdf/renderer"

import global from "./global"

export default StyleSheet.create({
  ...global,
  container: {
    width: "100%",
    display: "flex",
  },

  contact: {
    display: "flex",

    // height: "20%",
  },

  email: {
    color: "white",
    textDecoration: "none",
  },

  heading: {
    letterSpacing: 1.5,
    fontSize: 11,
    textTransform: "uppercase",
    margin: "15 0",
    color: "#d4b88a",
  },
})
